import React from "react";
import { Route, Routes } from "react-router-dom";

import Header from "./components/Header/Header";
import Main from "./components/Main/Main";

import "./App.css";


function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<Header />}></Route>
        <Route  element={Main} >
           <Route path="/" elem/>
        </Route>
      </Routes>
    </div>
  );
}

export default App;
